const db = [{"content":"\nI had the pleasure of doing an interview with the Women of BSV. In this video we discuss the Social Bitcoin Web and other Bitcoin-related things.","metadata":{"title":"Interview with Women of BSV","author":"ryan@ryanxcharles.com","date":"2021-12-11 13:00:00 PST","type":"video","youtubeId":"1CAo1i-rzCY"},"date":1639256400000,"filename":"interview-with-women-of-bsv.md"},{"content":"\nBuy a domain name. Set up a website at your domain. Set up email at your domain. Figure it out and get it done. When you do, email me and I will add a link to your website.\n\nMy domain: ryanxcharles.com\nMy website: [https://www.ryanxcharles.com](https://www.ryanxcharles.com)\nMy email: [ryan@ryanxcharles.com](mailto:ryan@ryanxcharles.com)","metadata":{"title":"Own Your Own Website","author":"ryan@ryanxcharles.com","date":"2021-12-11 12:00:00 PST","type":"video","youtubeId":"3seevH3GGeg"},"date":1639252800000,"filename":"own-your-own-website.md"},{"content":"","metadata":{"title":"Plants and animals in the wild don't take drugs. The only plants or animals that take drugs are the ones controlled by humans.","author":"ryan@ryanxcharles.com","date":"2021-12-08 12:00:00 PST","type":"aphorism"},"date":1638993600000,"filename":"plants-and-animals-dont-take-drugs.md"},{"content":"\nPlease join metanet.icu as a paid member and join the #sbw channel if you would like to collaborate on building the Social Bitcoin Web (SBW).","metadata":{"title":"How to Create Decentralized Search","author":"ryan@ryanxcharles.com","date":"2021-12-03 12:00:00 PST","type":"video","youtubeId":"5PWaqRQ-QYQ"},"date":1638561600000,"filename":"how-to-create-decentralized-search.md"},{"content":"","metadata":{"title":"How to Escape Collectivist Technocracy","author":"ryan@ryanxcharles.com","date":"2021-12-01 12:00:00 PST","type":"video","youtubeId":"-V9BCVB8fnU"},"date":1638388800000,"filename":"how-to-escape-collectivist-technocracy.md"},{"content":"","metadata":{"title":"The United States is Censored","author":"ryan@ryanxcharles.com","date":"2021-11-30 12:00:00 PST","type":"video","youtubeId":"k5uJUFSumPY"},"date":1638302400000,"filename":"the-united-states-is-censored.md"},{"content":"\nDavid Thunder has made reasonable arguments about COVID, but his Twitter account with 25,000 followers has been deleted with no recourse. It seems he has been deplatformed by Twitter because his arguments don't fit the mainstream narrative. I discovered him just this morning and find it truly disturbing that Twitter has deleted his account simply for saying something they disagree with.\n\nI recommend perusing his content available on [davidthunder.com](http://www.davidthunder.com) and arriving at your own opinion about whether it was the right call for Twitter to delete his profile. In my opinion this is obviously an abuse of Twitter's central position in society and a sign that we need to migrate everything off of Twitter and all other hyper-centralized social platforms (Google and Facebook) as quickly as possible. David Thunder is not the first reasonable voice I have seen deplatformed by the big social media companies.\n\nDavid owns his own domain name, davidthunder.com, which means it's very difficult to fully censor him. Although Twitter has deleted his account, which comes at a great cost, his voice cannot be wiped out so long as he has alternatives.\n\nThe domain name system (DNS) is administered by [ICANN](https://www.icann.org) and [IANA](https://www.iana.org). Although technically centralized, DNS is actually widely distributed because many different organizations and countries control all of the top-level domains (TLDs) like .uk, .es, and .com. [IANA has a list of all the organizations that administer each TLD on their website](https://www.iana.org/domains/root/db). It is interesting to browse through that list. Compare that list of organizations with Twitter. DNS vs. Twitter is massively distributed vs. highly centralized.\n\nYou can use a registrar like [Namecheap](https://www.namecheap.com) or [Godaddy](https://www.godaddy.com) to register a domain name. It is a good idea to register a domain name using a TLD that is in your country (like .uk for the UK and .es for Spain) and using a registrar that is located in your country. By relying on your country you guarantee that you have some say in the ownership of the domain name and it is unlikely a foreign adversary will ever be able to take it away. If you want to hedge against your own country, then you can buy a second domain name in a different country.\n\nYou will also need to get a website and email going at your domain name. I recommend [Wordpress](https://www.wordpress.com) as the simplest way to get a website going, and [Google Workspace](https://workspace.google.com), [Microsoft Exchange](https://www.microsoft.com/en-us/microsoft-365/business/compare-all-microsoft-365-business-products-b), or [Amazon WorkMail](https://aws.amazon.com/workmail/) for email hosting. But as with domain registrars, it is best to do your own research and find service providers in your own country.\n\nIf you get your own personal website going at your own domain name, you can email me at ryan@ryanxcharles.com and I will give you a link on my [friends](https://www.ryanxcharles.com/friends) page.","metadata":{"title":"Own Your Own Domain Name","author":"ryan@ryanxcharles.com","date":"2021-11-22 12:00:00 PST","type":"video","youtubeId":"8hiPP_KlrmI"},"date":1637611200000,"filename":"own-your-own-domain-name.md"},{"content":"\nThe **Social Bitcoin Web (SBW)** is a network of sovereign individuals. Do you own your own domain name with a personal web page and want want to get linked into the SBW? Please email me at ryan@ryanxcharles.com and I will give you a link.\n\n# Individuals\n\n[Craig Wright](https://craigwright.net). Creator of Bitcoin - Satoshi Nakamoto. Eternal student and researcher. nChain Chief Scientist. Lawyer, banker, economist, pastor, coder, investor, mathematician, stats, and world-curious. My opinions are my own.\n\n[Brad Meinert](https://bigbadbrad.com). Growth Hacker.\n\n[Will Townsend](https://will.townsend.io). I'm a human being who writes software, enjoys music, and lives in Vancouver BC üá®üá¶.\n\n[Sebastian Vanti](https://sebastianvanti.com) es un artista chileno - holand√©s.\n\n[Kurt Wuckert Jr.](https://kurtwuckertjr.com) Bitcoin Historian. Fighter. Family Man.\n\n[Ryan Wold](https://www.ryanwold.net). I'm grateful to be a son, husband, and father.\n\n[Framore's Journal](http://framore.net). My digital garden.\n\n[Stephan M. February](https://february.sg). Bitcoin developer.\n\n[Bryan Daugherty](https://bryandaugherty.net). Technology solution consultant.\n\n[Diddy Wheldon](https://www.diddywheldon.co.uk). Actress, Artist, B.Msc., BSV.\n\n[Mr Z](https://mrz1818.com). \"The majority see the obstacles; the few see the objectives; history records the successes of the latter, while oblivion is the reward of the former.\"\n\n[Vegard Wikeby](https://vegardwikeby.com). I help businesses with getting their online business profitable.\n\n[Kevin M. Healy](https://kevinmhealy.com). Bitcoin developer.\n\n[Kris Arsov](https://www.arsov.bg/). I'm a Salesforce Commerce Cloud Engineer at 5 PM Ltd.\n\n[Ty Everett](https://tyeverett.com/). An unquestioned answer is far worse than an unanswered question.\n\n[Ramiro Secco](https://ramirosecco.com). I‚Äôm a free thinker.\n\n[Burton Cummings](https://burtoncummings.io). \"You can have everything in life you want, if you will just help other people get what they want.\"\n\n[Wayne Gray](http://wayneg.net). I'm a father, programmer in logistics industry for many years, gamer, and occasional gardener.\n\n[Steve Patterson](http://steve-patterson.com). I am a philosopher, an author, and the host of \"Patterson in Pursuit.\" I am obsessed with learning and have traveled the world to interview intellectuals about big ideas.\n\n[Marcel Gruber](https://www.marcelgruber.ca). Senior Web Developer and Digital Marketing Consultant at Luxica Consulting Corp.\n\n[Steffen S√∏lling](https://bitcoinsteffen.com/). I help merchants let their customers pay with bitcoin.\n\n[Darren Kellenschwiler](https://www.kschw.com). Bitcoin entrepreneur.\n\n[Dave Mullen-Muhr](http://mullenmuhr.com/). Bitcoin investor.\n\n[Anette P Monde](https://monde.no). Author of the Bitcoin protocol specification.\n\n[Brad 1121](https://76a91488.ac/). Bitcoin developer.\n\n[S.H.](https://onchain.ch). Bitcoin developer.\n\n[Mark Jackson](https://remjx.com). A software & systems engineer living in Ellicott City, MD.\n\n[Devar](https://devar.xyz). Bitcoin developer.\n\n[Stephan Nilsson](https://stephannilsson.me). Welcome to the Social Bitcoin Web, think of it like a modern day webring, but utilising electronic peer-to-peer cash.\n\n[J. Christopher Stearns](https://stearns.pub). Everything.\n\n[Jack R Rogers](http://jackrrogers.uk). I am a Lecturer (Education & Scholarship) in the Economics Department of the University of Exeter Business School.\n\n[Daniel Douglas](https://www.danieldouglas.nl). Artist Daniel Douglas (1984) finds his inspiration in the Dutch masters from the 17th century. They were the first painters to start telling a story with light. Douglas brought this theme into our modern age.\n\n[Valokuvia Suomesta](https://pjti.fi/?). Alapuolella n√§ytet√§√§n sellaisia valokuvia, joita olen viime aikoina ottanut, ja joista pid√§n.\n\n[Tom Hatcher](http://www.tomhatcher.us). These are mostly my creations, computer programs, stories, and videos, from the past and present.\n\n[Eric Martin](https://ericmartinpe.com). Mechanical engineer.\n\n[Diego Cortes](https://diegocortes.xyz/). CEO of Diego Cortes.\n\n[Liam Chai](https://www.liamchai.com). ‚ÄúThe most important thing is to remember the most important thing.‚Äù ‚Äì Suzuki Roshi\n\n[Peter Blain](https://www.peterblain.com). I'm a product focused technology leader and engineer.\n\n# Organizations\n\n[MetaNet.ICU](https://metanet.icu). The new global economy.\n\n[Fluridium](http://www.fluridium.com). I am building a WARP enabled spaceship.\n\n[Blarecast](https://blarecast.com). BLARECAST is an innovative media distribution platform for artists and content creators.\n\n[Take Your Brand To The Blockchain](https://www.takeyourbrandtotheblockchain.com). Are you Ready to Monetize Your Content on the Blockchain? You‚Äôre in the right place!\n\n[Brand On-Chain](http://brandonchain.com). This is How We Fix the Internet, Without Getting Rid of the Things We Love About It!\n\n[Deep Thawtz](https://www.deepthawtz.com). DEEPTHAWTZ Studios grew out of a side hustle after Dylan Clendenin sold his first artwork in September 2020. Dylan draws and paints what he likes, doesn‚Äôt overthink it and will keep working regardless of the results.\n\n[Unisot](https://unisot.com/sbw/). Truth. Transparency. Trust.\n\n# Following\n\nI respect and follow these people but have not ever had direct engagements with them. They may or may not know who I am. Either way, they are doing good work and I recommend following them.\n\n[David Thunder](http://www.davidthunder.com). By profession I am a university lecturer and researcher in moral, political, and social philosophy.\n\n[Paul Saladino](https://carnivoremd.com). Carnivore MD. Attain radical health, strength, & vitality.\n\n[Shawn Baker](https://shawn-baker.com). Author of \"The Carnivore Diet\" and CEO of Revero Health.\n\n[Rob Henderson](https://www.robkhenderson.com). I am interested in human nature.\n\n[Jordan Peterson](https://www.jordanbpeterson.com). Dr. Jordan B. Peterson is a professor of psychology at the University of Toronto, a clinical psychologist, and the author of the bestsellers \"Beyond Order: 12 More Rules for Life\" & \"12 Rules for Life: An Antidote to Chaos\".\n\n[Dan Astin-Gregory](https://www.danjgregory.com). Over the past decade Dan has directly impacted the lives of more than 100,000 entrepreneurs and business leaders from over 90 different countries with his work in human potential, leadership and entrepreneurship.\n\n[Children's Health Defense](https://childrenshealthdefense.org). ‚ÄúThe greatest crisis that America faces today is the chronic disease epidemic in America‚Äôs children.‚Äù - Robert F. Kennedy Jr.\n\n[Corbett Report](http://corbettreport.com). Open source intelligence news.\n\n[Steve Kirsch](https://www.skirsch.io). I'm a serial entrepreneur who has started multiple high tech companies. See also [skirsch.com](https://www.skirsch.com).\n\n[Gary Null](https://garynull.com). Health. Happiness. Longevity.\n\n[Dr. Jessica Rose](https://i-do-not-consent.netlify.app). Jessica Rose is a Research Fellow at the Institute for Pure and Applied Knowledge.\n\n[Doctors for COVID Ethics](https://doctors4covidethics.org). We are doctors and scientists from 30 countries, seeking to uphold medical ethics, patient safety and human rights in response to COVID-19.\n\n[Unknowing (Frank McCaughey)](https://www.unknowing.life/). What appears to be happening is reading this.\n\n[Russell Brand](https://www.russellbrand.com). Celebrity podcaster.\n\n[Dr. Joe Dispenza](https://drjoedispenza.com). Our community is made up of doers, people who want to be challenged to do the uncommon, the supernatural, and the mystical.\n\n[Hoover Institution](https://www.hoover.org). With its eminent scholars and world-renowned Library and Archives, the Hoover Institution is a public policy think tank that seeks to improve the human condition by advancing ideas that promote economic opportunity and prosperity, while securing and safeguarding peace for America and all mankind.\n\n[Dr. Sam Bailey](https://drsambailey.com). The Natural Healing Force: \"Within each of us is the greatest force in getting well\" ‚Äì Hippocrates.\n\n[Dr. Tom Cowen](https://drtomcowan.com). Forging a common sense approach to medicine and biology.\n\n[Mirjam Janse](https://www.mirjamjanse.com). Transformational coaching.\n\n[America's Frontline Doctors](https://americasfrontlinedoctors.org). Medical And Legal Resources To Defend Your Freedom: Advocates for Liberty, Health, and Justice.\n\n[The Dr. Ardis Show](https://thedrardisshow.com). In early 2020 I lost my Father-in-law because of ill-advised hospital protocols. Since that time, I have been on a mission to help educate the public about the dangers to Americans, in many of our \"institutes of health\".\n\n[The Last American Vagabond](https://www.thelastamericanvagabond.com). Traveling the world, writing what the people need to know.\n\n[Global Research](https://www.globalresearch.ca). Centre for research on globalization.\n\n[The Press and the Public](https://www.thepressandthepublic.com). Videos about the pandemic.\n\n[Max Igan](https://thecrowhouse.com). The CrowHouse. Spiritual leader who escaped the tyranny of Australia.\n\n[ThriveOn](https://www.thriveon.com/). Kimberly Carter Gamble and Foster Gamble.\n\n[Awaken with JP](https://awakenwithjp.com). It's funny because it's true.\n\n[David E. Martin](https://www.davidmartin.world/). Dr. David Martin knows who he is.  And he‚Äôs here to show others how to remember what it means to put humanity into the human experience.\n\n[Catherine Austin Fitts](https://home.solari.com). The Solari Report. Money, markets, and COVID.\n\n[Maria Ryan](https://www.drmariaryan.com). Be passionate and give back.\n\n[General Flynn](https://www.generalflynn.com). General Flynn was National Security Advisor to President Donald J Trump and previously he was the director of the Defence Intelligence Agency.","metadata":{"title":"Friends","author":"ryan@ryanxcharles.com","date":"2021-11-20 12:00:00 PST","type":"page"},"date":1637438400000,"filename":"friends.md"},{"content":"\n# Introduction\n\nI've been involved in Bitcoin since May 13, 2011 when I read an article about Bitcoin on Hacker News. It struck me that Bitcoin had the potential to be the foundation of a new global industry like the internet, but with money instead of communications. I was hooked right away and spent weeks researching it.\n\nThat was more than ten years ago now. Since then I have had the fortunate of getting to know the inventor of Bitcoin, Craig Wright (a.k.a. Satoshi Nakamoto), and I have been able to learn directly from him about the entire theoretical background of Bitcoin and every line of the Bitcoin white paper.\n\nMy discussions with the inventor of Bitcoin are freely available in the [Theory of Bitcoin](https://www.theoryofbitcoin.com) interview series. [I recommend watching every interview in chronological order using this playlist](https://www.youtube.com/playlist?list=PLOqZWfHm-gzDjTBDiDAZEp8sBUkphnaGe). The full interview series is more than 50 hours in length which is the equivalent of about five audio books. It is is well worth the time of every person full-time involved in the industry to watch the entire interview series.\n\nThis introduction is an outline of the key concepts discussed in Theory of Bitcoin. It is available both in the form of a [video](https://youtu.be/fj6zk8DIimc) and this article summarizing all of the concepts.\n\n# Basics\n\n* The definition of Bitcoin is contained in the [Bitcoin white paper](https://craigwright.net/bitcoin-white-paper.pdf) published by Satoshi Nakamoto (Craig Wright) on October 31, 2008.\n* The definition is expanded in the original source code used to launch Bitcoin in January of 2009.\n* Bitcoin is a peer-to-peer electronic cash system. This is the title of the white paper: \"Bitcoin: A Peer-to-Peer Electronic Cash System\".\n* \"Peer-to-peer\" has two different meanings: The users send transactions peer-to-peer and the miners connect to each other peer-to-peer.\n* Users send transactions from one to the other, peer-to-peer, just like handing a physical cash note to someone in the real world, but electronic instead of physical.\n* The miners all connect together in a small world graph. \"Small world\" just means that each miner connects to each other miner. They form a peer-to-peer network.\n* Users are not miners. Users run Simplified Payment Verification (SPV), which is a light node that monitors block headers and maintains the user's own transactions, but not the transactions of others.\n* Miners see all transactions. Users only see their own transactions.\n\n# Blockchain\n\n* The blockchain is the history of all transactions. It is completely public plaintext information that anyone can audit.\n* The blockchain consists of a chain of blocks. Each block includes all transactions that were created since the last block.\n* Miners create blocks. If you are not creating blocks then you aren't a miner. A \"node\" in the white paper means a miner. It does not mean SPV nodes. SPV nodes are users.\n* A new block is created on average once every ten minutes. The true length of time is random but always averages ten minutes.\n* The difficulty of mining a block is adjusted automatically to ensure that it always takes approximately ten minutes to produce a block.\n* Miners must produce a proof-of-work (PoW) hash in each block which is a hash starting with a small number of zeros to prove they have spent real-world resources mining the block.\n* Proof-of-work is an algorithm for the Handicap Principle. The Handicap Principle is a biological idea that species create costly signals to indicate health, like a peacock's tail or the horns of an antelope. The proof-of-work hash is the beautiful tail of the miner.\n\n# Law\n\n* Bitcoin is an evidence system that brings law to the internet.\n* Bitcoin is not anarchist. Bitcoin is designed to operate in a system of laws.\n* Bitcoin works because the law works. If you need to, such as when a counterparty commits fraud, you can use the immutable evidence from the blockchain in court.\n* Bitcoin does not work in an anarchist system because contracts are not enforceable and anyone can change the rules at any time. The rules are only set in stone insofar as contracts are enforceable, which requires law.\n* Bitcoin makes it easier to follow existing regulations in business. For instance, Sarbanes-Oxley requires public companies to keep immutable accounting records. Bitcoin makes this truly possible for the first time, if utilized properly, by making it impossible to have two sets of books.\n* Bitcoin makes it easier for governments to collect taxes, if utilized properly, by making all tax payments transparent.\n* Bitcoin makes it easier to hold governments accountable, if utilized properly, by making tax collection transparent and auditable by the people.\n\n# Computer Science\n\n* Bitcoin is Turing Complete, which means it can compute any number. It can do anything that any computer can do.\n* Each transaction in Bitcoin has multiple inputs and multiple outputs.\n* An output has a value of satoshis (one satoshi is one hundred millionth of a bitcoin) and a script, sometimes called a locking script.\n* An input contains a reference to an earlier output and includes a script that is sometimes called an unlocking script.\n* To check an input for validity, execute the input script, and then execute the linked output script. If the return value is not false, then the input is valid.\n* A transaction is valid if all inputs are valid and if the transaction satisfies other sanity checks such as that they do not create Bitcoin out of thin air.\n* There is one case where a transaction can create Bitcoin out of thin air, which is if it is the first transaction in a block. These are called coinbase transactions and they are where miners get the mining reward.\n\n# Computer Security\n\n* There is no such thing as perfect security. Security is always and everywhere economic. An economically secure system is a system that is more costly to attack than the gain from attacking it.\n* Bitcoin is economically secure because it costs more to attack it than the gain from attacking it.\n* Quantum computers are not a threat to Bitcoin. Firstly, because they are unlikely to be commercially viable any time soon. And secondly, because quantum computers cannot crack hash functions, public keys can simply be hidden when they are not needed, and can store an amount of value that is lower than the cost of cracking them when they must be revealed.\n* Public keys should never be re-used on the blockchain both for privacy and to deter cracking attempts.\n* Proof-of-work is not a security mechanism. Proof-of-work is a mechanism to de-anonymize miners. Miners cannot be anonymous because they must use large data centers to be competitive which always have discoverable locations in the real world through the use of traditional network scanning tools.\n* Bitcoin is decentralized because it has no central point of failure, not because everybody runs a node.\n* Users run SPV wallets which track the block headers. The wide distribution of block headers through the ubiquitous use of SPV is necessary to secure the network because the wide distribution of the block headers is what enables users to hold miners accountable. Miners cannot commit fraud such as through creating more than 21 million bitcoin not because everyone runs a node but because everyone has the block headers and can prove if the miners do commit fraud.\n\n# Economics\n\n* Bitcoin is an economic system because the security and functioning of the system uses economic incentives.\n* The miners are independent businesses that compete to earn more bitcoin for processing transactions. Better miners are more profitable.\n* Pre-consensus is incompatible with Bitcoin beacause it creates collaboration between miners which ruins their independendence and creates a cartel which is a central point of failure.\n* There are and will always be a small number of large miners and a large number of small miners. This is called the Pareto distribution or the 80/20 rule.\n* There is a fixed supply of bitcoin, approximately 21 million, with a variable price. There is no way to fix the price to any real-world asset without creating a central point of failure, so a fixed supply instead is the only solution.\n* Bitcoin is decentralized because anybody can run a node, not because everybody does run a node.\n\n# Networks\n\n* The miners form a small world graphic, meaning each miner connects to every other miner.\n* The users, or SPV nodes, form something like a mesh network, because every user is connect to some subset of other users directly but not all. \n* Theoretically, the miners and users form a Mandala network, which has a highly connected central core (the miners) and a lightly connected outer shell (the users).\n* In practice, the network structure resembles a Mandala network, but the true network structure is determined by whoever the miners and users are actually connected to.\n\n# Identity\n\n* Bitcoin is private, but not anonymous. Bitcoin does not require identity for micropayments. But Bitcoin does require identity for moderate or large payments.\n* Bitcoin is private because identity information is not included on the blockchain. Best practice is not to re-use addresses and to not merge outputs. If this best practice is followed, it is very difficult to infer real-world identity from public data. As the network grows, it becomes even more difficult to infer real-world identity like finding a needle in a haystack that gets bigger and bigger with time.\n* Bitcoin does not include a solution to identity. Identity is firewalled from the blockchain and must be provided by a separate system.\n* Moderate and large transactions require the exchange of identity information for the security and compliance of the parties involved.\n* Bitcoin is not anonymous for anything other than micropayments because fiat gateways always require identity to be revealed.\n\n# Cryptocurrency\n\n* Bitcoin is not a cryptocurrency. \"Crypto\" means secret writing and \"currency\" means government money. Bitcoin is neither of these.\n* Bitcoin is not encrypted. Bitcoin is completely public plaintext information that anyone can audit.\n* Bitcoin could be a currency, a.k.a. government money, if a government enabled citizens to pay tax with it.\n* BTC is not Bitcoin. BTC is a fork of Bitcoin created by the Bitcoin Core developers in 2017.\n* BTC is not Bitcoin because it includes segwit, which breaks the definition of a \"coin\" in the white paper by removing the signatures from the transaction chain.\n* BTC is not Bitcoin because it strictly limits the maximum block size, which limits the volume of transactions and breaks the long-term viability of BTC as a competitive electronic cash system.\n* BTC is passing off as Bitcoin. If you bought BTC anytime from 2017 until now and are under the impression that it is Bitcoin, then you have been scammed.\n* The cryptocurrency industry is a giant scam created by pump-and-dump scammers and drug dealers and has nothing to do with Bitcoin.\n\n# History\n\n* David Chaum published some of the original ideas in the 1980s. DigiCash was David Chaum's company. Chaum's work also goes by the name Chaumian eCash.\n* There were many peer-to-peer electronic cash systems in the 1990s and 2000s, including Mojo Nation.\n* Bitcoin is very similar to the 1999 solution by Massias et al. (see reference #2 in the white paper) except where the network itself distributes the block headers instead of publishing them in a separate newspaper.\n* Craig Wright published the Bitcoin white paper on October 21, 2008.\n* The Bitcoin network was started with Craig Wright's nodes in January, 2009.\n* The ticker symbol representing Bitcoin on exchanges is BSV. BTC is not Bitcoin.\n\n# Future\n\n* The most important next step in the future of Bitcoin is the widespread adoption of SPV wallets in the ecosystem for security and scalability.\n* Alongside SPV, we must implement an identity system to enable the use of real-world identity where appropriate, such as large payments and exchanges.\n* Once these new protocols are developed and adopted, advanced applications can be created such as Internet of Things (IoT), supply chain, finance, and anything else at the intersection of value and communication.\n\n# Satoshi Nakamoto\n\n* Bitcoin was invented by Satoshi Nakamoto.\n* The true identity of Satoshi Nakamoto is Craig S. Wright, an Australian-British polymath genius with Asperger Syndrome.\n* Craig Wright is the Chief Scientist of nChain, a company he founded for Bitcoin research and development.\n* Craig Wright has a doctorate in theology, a PhD in computer science, and more than 17 degrees in total.\n* Craig Wright has credentials spanning computer security, computer science, law, economics, and many other areas, most of which are relevant to Bitcoin.\n* Craig Wright is pursuing more doctorates, graduate-level degees, undergraduate degrees, and other credentials to this day.\n\n# Ryan X. Charles\n\n* I discovered Bitcoin on May 13, 2011.\n* I quit my physics PhD in the summer of 2013 and to pursue Bitcoin full-time.\n* I have developed or worked on Bitcoin wallets as an engineer at [BitPay](https://www.bitpay.com), [reddit](https://www.reddit.com), and [BitGo](https://www.bitgo.com).\n* I started my own company in August 2015. The company would become called Yours Inc. and was incorporated in the summer of 2016.\n* Yours Inc. created two Bitcoin wallets: One for Yours.org, a social network with micropayments for funding content creators, and [Money Button](https://www.moneybutton.com), a Bitcoin Wallet as a Service (WaaS) for consumers and businesses.\n* The IP of Yours Inc. was sold to [The Bayesian Group](https://www.bayesian.com) in September of 2020. Bayesian rebranded to [Fabriik](https://www.fabriik.com) shortly after the acquisition. I resigned from Fabriik in February of 2021.\n* I started my second company, [Coasian](https://www.coasian.com), in Februrary of 2021.\n* The primary technology of Coasian is [OpenSPV](https://www.openspv.com), a full-stack open-source SPV wallet implementation. OpenSPV is the 6th Bitcoin wallet I have created or worked on. It is being used inside products for consumers and businesses that will launch in 2022.\n\n# Conclusion\n\nBitcoin is a peer-to-peer electronic cash system. Bitcoin is extremely interdisciplinary and in order to understand the full scope of Bitcoin, one must learn many different fields of study. Those fields of study include but are not limited to computer science, economics, and law. Few people have already mastered all of the background material necessary to understand Bitcoin, and as such most students of Bitcoin should expect to spend years studying material in order to have a complete understanding. The outline given in this article can be used as a guide for further study.","metadata":{"title":"Introducing Bitcoin","author":"ryan@ryanxcharles.com","date":"2021-11-19 13:00:00 PST","type":"video","youtubeId":"fj6zk8DIimc"},"date":1637355600000,"filename":"introducing-bitcoin.md"},{"content":"","metadata":{"title":"BTC is Not Bitcoin","author":"ryan@ryanxcharles.com","date":"2021-11-09 13:00:00 PST","type":"video","youtubeId":"ABg67HsixIA"},"date":1636491600000,"filename":"btc-is-not-bitcoin.md"},{"content":"","metadata":{"title":"Why I Deleted Twitter With 26,000 Followers","author":"ryan@ryanxcharles.com","date":"2021-11-09 12:00:00 PST","type":"video","youtubeId":"K3qJSka6fmQ"},"date":1636488000000,"filename":"why-i-deleted-twitter-with-26k-followers.md"},{"content":"\nI had over 26,000 followers on Twitter and could easily get attention by tweeting something. However, Twitter made me feel disgusting every time I opened it up. Even though I tried only to look at my own profile, they put advertisements for other tweets that I don't want to see everywhere. I found it very easy to click through and start viewing other people's tweets on Twitter. It is psychologically addictive and hard to look away. However, I gained nothing and only cringed every time I looked at it. I even fell for a scam in the past week and had to do an hour's worth of research to convince myself it was just a scam and calm down. The scam was just a website promoting a false claim in order to get clicks to scam advertisers. How irritating.\n\nTwitter does not promote the truth. Twitter promotes whatever creates engagement. What Twitter promotes is false about 50% of the time. It is completely unreliable as a way to learn about what is going on in the world. I do not agree with Twitter's principles and do not want to continue to harm my own psychology by using it. Furthermore, even though I stand a lot to gain by putting advertisements for my work on there, I do not want to continue to promote Twitter itself by advertising my work with it, because it forces other people to look at Twitter just to see what I am up to. The only ethical thing to do is to delete my profile and to stop promoting it completely.\n\nI know a small number of people have bookmarked my personal web page and will see this message. All new updates will be on my personal home page first, and on other social platforms second. Please come back from time to time to see new content and see what I am up to.\n\nI am serious about the Social Bitcoin Web (SBW). It is bigger than you think. I will publish more technical information soon. Please get your personal web page going. I am going to monitor the previously mentioned links for updates. Let's link to each other and build a better web where we are all in control over our own identity and content.\n\nIf you want to contact me, my email address is my first name at my personal domain name dot com.","metadata":{"title":"Why I Deleted My Twitter Account","author":"ryan@ryanxcharles.com","date":"2021-11-08 12:00:00 PST","type":"article"},"date":1636401600000,"filename":"why-i-deleted-my-twitter-account.md"},{"content":"      \nIf you are going to engage with other people in business, sometimes things go wrong. When they go wrong, corporations enable you to limit liability.\n\nImagine you provide a service like a hosted Bitcoin wallet. You take every precaution to secure your users' funds. Unfortunately, one day your service is hacked, and your users' funds are stolen.\n\nSo long as you followed the law at every step, your users can sue your corporation for their funds, but they cannot sue you personally. This means while your corporation may go bankrupt in order to pay out to your users, you do not personally go bankrupt. This is the entire reason why corporations exist.\n\nCreating a corporation is not expensive. Every person in the world who engages with others economically has every reason to create a corporation. Even if you are an employee of someone else's corporation, you may have other business interests outside of your employer and you should create a corporation for all your business activity.\n\nBest practices for creating a corporation depend on what country you live in and where you do business. For US companies that intend to go public, you should create a Delaware C corp. For US corporations that do not want to go public and want to minimize taxes, you should use an LLC, and you should research which state is best for you. You do not have to incorporate in the same state where you live, but you do need to register there. For outside the US, there are countless options. You do not necessarily need to incorporate in your home country, but you likely need to register in your home country.\n\n[Coasian Inc.](https://www.coasian.com/) is a Delaware C corp because I want the option to go public in the future.","metadata":{"title":"The Purpose and Value of Corporations","author":"ryan@ryanxcharles.com","date":"2021-11-07 12:00:00 PST","type":"article"},"date":1636315200000,"filename":"the-purpose-and-value-of-corporations.md"},{"content":"      \nThe Social Bitcoin Web (SBW) is a new social network where everybody is a sovereign individual. The following individuals and organizations have agreed to be linked from my personal web page to begin building the SBW.\n\n**Individuals**.\n\n[Brad Meinert](https://bigbadbrad.com). Growth Hacker.\n\n[Will Townsend](https://will.townsend.io). I'm a human being who writes software, enjoys music, and lives in Vancouver BC üá®üá¶.\n\n[Sebastian Vanti](https://sebastianvanti.com) es un artista chileno - holand√©s.\n\n[Kurt Wuckert Jr.](https://kurtwuckertjr.com) Bitcoin Historian. Fighter. Family Man.\n\n[Ryan Wold](https://www.ryanwold.net). I'm grateful to be a son, husband, and father.\n\n[Framore](http://framore.net). This site is how I believe the internet should be: not the products of big corporations but various sites curated by each user.\n\n[Stephan M. February](https://february.sg). Bitcoin developer.\n\n[Bryan Daugherty](https://bryandaugherty.net). Technology solution consultant.\n\n[Diddy Wheldon](https://www.diddywheldon.co.uk). Actress, Artist, B.Msc., BSV.\n\n[Mr Z](https://mrz1818.com). \"The majority see the obstacles; the few see the objectives; history records the successes of the latter, while oblivion is the reward of the former.\"\n\n[Vegard Wikeby](https://vegardwikeby.com). I help businesses with getting their online business profitable.\n\n[Kevin M. Healy](https://kevinmhealy.com). Bitcoin developer.\n\n[Kris Arsov](https://www.arsov.bg/). I'm a Salesforce Commerce Cloud Engineer at 5 PM Ltd.\n\n[Ty Everett](https://tyeverett.com/). An unquestioned answer is far worse than an unanswered question.\n\n[Ramiro Secco](https://ramirosecco.com). I‚Äôm a free thinker.\n\n[Burton Cummings](https://burtoncummings.io). \"You can have everything in life you want, if you will just help other people get what they want.\"\n\n**Organizations**.\n\n[Fluridium](http://www.fluridium.com). I am building a WARP enabled spaceship.\n\n[Blarecast](https://blarecast.com). BLARECAST is an innovative media distribution platform for artists and content creators.\n\nThe SBW is based on the web, Bitcoin, and social networks. It uses new extensions to [paymail](https://www.bsvalias.org) to make a true market of information. It is just getting started. To join the network, purchase a domain name for yourself, set up a personal web page, and get linked into it.","metadata":{"title":"First Links in the Social Bitcoin Web","author":"ryan@ryanxcharles.com","date":"2021-11-06 12:00:00 PST","type":"article"},"date":1636228800000,"filename":"the-first-links-in-the-sbw.md"},{"content":"","metadata":{"title":"How I Know Craig Wright is Satoshi Nakamoto","author":"ryan@ryanxcharles.com","date":"2021-11-02 12:00:00 PST","type":"video","youtubeId":"jvu0yoZFjF4"},"date":1635883200000,"filename":"how-i-know-craig-wright-is-satoshi-nakamoto.md"},{"content":"\nThe **Social Bitcoin Web (SBW)** is a set of protocol extensions to Paymail, Bitcoin, and the Web that connects real-world identity (private by default, of course) to electronic cash payments over the internet. This makes it possible to have a true market of information. The economics-first model fixes many issues, most especially the subversive misallocation of attention caused by the overreliance on ad-funded media (social and traditional). We will fix the attention issue first. Then we will fix every other issue.\n\nWe‚Äôre going to build the Social Bitcoin Web together publicly on social media. Big Tech companies like Meta (Facebook, Instagram, WhatsApp), Twitter, and so on, will be able to follow along and pivot their business models over time. But our network will have many opportunities to outcompete them if we can move faster than they do.\n\nStep 1. **Buy a domain name for yourself**. Your domain name should have a TLD corresponding to your country. If you live in Spain, your domain name should be [yourname].es, for instance.\n\nStep 2. **Host a personal web page on your domain name that you fully control and that serves as the entry point to your public persona**. You don‚Äôt have to share everything about your private life. Just share the information you want. Take pride in your personal web page. This is your new profile (not your Instagram).\n\nYou should be able to get these things going in one day. If you‚Äôre busy, no more than one week. Remember you can iterate. The first version doesn‚Äôt have to be perfect. You can make it better tomorrow.\n\nMy domain name is [ryanxcharles.com](https://www.ryanxcharles.com/). Bookmark my web page. You‚Äôll notice this message is replicated across my web page, Instagram, Facebook, Medium, and LinkedIn. Please share a link to your web page in the comments to this message on social media. I will link the ones I like from my web page. This is the beginning.\n\n[Instagram](https://instagram.com/ryan_x_charles) | [Medium](https://medium.com/@ryanxcharles) | [GitHub](https://github.com/ryanxcharles) | [YouTube](https://www.youtube.com/user/ryanxcharles/) | [LinkedIn](https://www.linkedin.com/in/ryanxcharles) | [Facebook](https://www.facebook.com/ryanxcharles) | [Last.fm](http://www.last.fm/user/ryancarnated) | [Gab](https://gab.com/ryanxcharles)","metadata":{"title":"Introducing the Social Bitcoin Web","author":"ryan@ryanxcharles.com","date":"2021-11-01 12:00:00 PST","type":"article"},"date":1635796800000,"filename":"introducing-the-sbw.md"},{"content":"","metadata":{"title":"Friend in Sonoma ‚ù§Ô∏è","author":"ryan@ryanxcharles.com","date":"2021-10-17 12:00:00 PST","type":"image","width":600,"height":800,"base64":"data:image/jpeg;base64,"},"date":1634500800000,"filename":"friend-in-sonoma.md"},{"content":"","metadata":{"title":"One's greatest work of art is one's life.","author":"ryan@ryanxcharles.com","date":"2021-09-01 12:00:00 PST","type":"aphorism"},"date":1630526400000,"filename":"ones-greatest-work-of-art-is-ones-life.md"},{"content":"","metadata":{"title":"The limits are all in your head.","author":"ryan@ryanxcharles.com","date":"2021-08-01 12:00:00 PST","type":"aphorism"},"date":1627848000000,"filename":"the-limits-are-all-in-your-head.md"},{"content":"","metadata":{"title":"Craig Wright is Satoshi Nakamoto","author":"ryan@ryanxcharles.com","date":"2018-08-29 12:00:00 PST","type":"aphorism"},"date":1535572800000,"filename":"craig-wright-is-satoshi-nakamoto.md"}]
